function SeatElement(props) {
    return (
        <div className="seatElement">
            {props.Seat.isOccupied ? (
                <div className="seatElementOccupied">
                    <p className="seatFont">{props.Seat.number}</p>
                </div>
            ) : (
                <div className="seatElementFree">
                    <b><p className="seatFont">{props.Seat.number}</p></b>
                </div>
            )}
        </div>
    );
}

export default SeatElement;
